void mainImage( out vec4 fragColor, in vec2 fragCoord )
{
	vec2 uv = fragCoord.xy / iResolution.xy;
	fragColor = vec4(distance(
        dot(
            -dot(
                dot(
                    uv, uv),
                -dot(
                    uv, uv)
                ),
            dot(
                -dot(
                    uv, uv),
                dot(
                    uv, uv)
                )
            ),
        -dot(
            dot(
                -dot(
                    uv, uv),
                dot(
                    uv, uv)
                ),
            -dot(
                dot(
                    uv, uv),
                -dot(
                    uv, uv)
                )
            )
        )
    );
}
